import React from "react";
import { useNavigate } from "react-router-dom";
import "../styles/styles.css";

const Index = () => {
  const navigate = useNavigate();

  return (
    <div>
      <h2>Bienvenido</h2>
      <button onClick={() => navigate("/")}>Inicio</button> {/* 游댳 Bot칩n de navegaci칩n temporal */}
      <button onClick={() => navigate("/profile")}>Mi Perfil</button> {/* 游댳 Se a침adir치 perfil m치s adelante */}
    </div>
  );
};

export default Index;
